import React from "react";
import UnauthorizedAccessTable from "./components/UnauthorizedAccessTable";
import AccessLogsChart from "./components/AccessLogsChart";

const App = () => {
  return (
    <div className="p-6 bg-gray-100 min-h-screen">
      <h1 className="text-3xl font-bold text-center mb-6">Log Analyzer</h1>
      <UnauthorizedAccessTable />
      <AccessLogsChart />
    </div>
  );
};

export default App;
